DROP TRIGGER IF EXISTS `before_users_insert`;
DELIMITER $$
CREATE TRIGGER `before_users_insert` BEFORE INSERT ON `users` FOR EACH ROW BEGIN
  -- Reference
  IF NEW.Reference IS NULL THEN
    SET NEW.Reference = (SELECT IFNULL(MAX(`Reference`),0)+1 FROM users);
  END IF;

  -- user_barcode
  IF NEW.user_barcode IS NULL THEN
    SET NEW.user_barcode = (SELECT IFNULL(MAX(user_barcode),0)+1 FROM users);
  END IF;

  -- parking_number (example: simple numeric increment)
  IF NEW.parking_number IS NULL THEN
    SET NEW.parking_number = (SELECT CONCAT('PN-', LPAD(IFNULL(MAX(SUBSTRING(parking_number,4)),0)+1,6,'0')) FROM users);
  END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `trg_users_before_insert`;
DELIMITER $$
CREATE TRIGGER `trg_users_before_insert` BEFORE INSERT ON `users` FOR EACH ROW BEGIN
  -- Reference (numeric, unique)
  IF NEW.Reference IS NULL OR NEW.Reference = 0 THEN
    SELECT COALESCE(MAX(CAST(`Reference` AS UNSIGNED)), 0) + 1
      INTO @nextRef
      FROM users;
    SET NEW.Reference = @nextRef;
  END IF;

  -- user_barcode (numeric, unique)
  IF NEW.user_barcode IS NULL OR NEW.user_barcode = 0 THEN
    SELECT COALESCE(MAX(CAST(user_barcode AS UNSIGNED)), 0) + 1
      INTO @nextUB
      FROM users;
    SET NEW.user_barcode = @nextUB;
  END IF;

  -- parking_number: CODE-###### (unique)
  IF NEW.parking_number IS NULL OR NEW.parking_number = '' THEN
    SET @camp_code := NULL;

    -- Prefer campus_id
    IF NEW.campus_id IS NOT NULL THEN
      SELECT code INTO @camp_code
      FROM campuses
      WHERE id = NEW.campus_id
      LIMIT 1;
    END IF;

    -- Fallback to Campus name if provided
    IF @camp_code IS NULL AND NEW.Campus IS NOT NULL THEN
      SELECT code INTO @camp_code
      FROM campuses
      WHERE name = NEW.Campus
      LIMIT 1;
    END IF;

    -- Default if still unknown
    IF @camp_code IS NULL THEN
      SET @camp_code := 'UNK';
    END IF;

    -- Next sequence for this campus code
    SELECT COALESCE(MAX(CAST(SUBSTRING_INDEX(parking_number, '-', -1) AS UNSIGNED)), 0) + 1
      INTO @nextPN
      FROM users
      WHERE parking_number LIKE CONCAT(@camp_code, '-%');

    SET NEW.parking_number = CONCAT(@camp_code, '-', LPAD(@nextPN, 6, '0'));
  END IF;

  -- Timestamps
  IF NEW.created_at IS NULL THEN
    SET NEW.created_at = NOW();
  END IF;
  SET NEW.updated_at = NOW();
END
$$
DELIMITER ;
